import React from 'react';
import TopBar from '../TopBar/TopBar';
import './header.scss';
import MidlleBar from "../MidlleBar/MidlleBar";

const Header = () => {
    return (
        <header className="header">
            <div className="topBarWrapper">
                <div className="container">
                    <TopBar />
                    <MidlleBar/>
                </div>
            </div>
        </header>
    );
};

export default Header;
